    [Test]
    public void Text_Search_BoyerMoore_Naive_Success()
    {
        foreach(var (text, pattern) in Texts.Zip(Patterns))
        {
            try
            {
                var documentMatches = new BoyerMoore().Search(ArtText.GetCodepoints(text), ArtText.GetCodepoints(pattern), meta: ZAlgorithm.Naive);
                var contentMatches = GetMatches(text, pattern);
                Assert.That(documentMatches.SequenceEqual(contentMatches), Is.True);
            }
            catch(Exception ex)
            {
                var m = ex.Message;
                Console.WriteLine($"text: {text}");
                Console.WriteLine($"pattern: {pattern}");
                break;
            }
        }
    }

