            {
                var contentMatches = GetMatches(loadedContent, pattern);
                Console.WriteLine($"contentMatches: {contentMatches.Count}");

                var documentMatches = new BoyerMoore(TextEncoding.Unicode).Search(ArtText.GetCodepoints(loadedContent),
                                                                                  ArtText.GetCodepoints(pattern),
                                                                                  meta: ZAlgorithm.Naive);
                Assert.That(documentMatches.SequenceEqual(contentMatches), Is.True);

                documentMatches = new BoyerMoore(TextEncoding.Unicode).Search(ArtText.GetCodepoints(loadedContent),
                                                                              ArtText.GetCodepoints(pattern),
                                                                              meta: ZAlgorithm.Gusfield);
                Assert.That(documentMatches.SequenceEqual(contentMatches), Is.True);
            }
        }
    }
}
